<!DOCTYPE html>
<html lang="en">
<head>
<meta charset="UTF-8">
<title>Valentine üíó</title>

<link href="https://fonts.googleapis.com/css2?family=Press+Start+2P&display=swap" rel="stylesheet">

<style>
  :root {
    --pink:#d64b7f;
    --bg:#fde6ef;
  }

  body{
    margin:0;
    min-height:100vh;
    display:flex;
    justify-content:center;
    align-items:center;
    background:var(--bg);
    font-family:"Press Start 2P", cursive;
    overflow:hidden;
  }

  .window{
    width:440px;
    background:#ffd6e6;
    border:6px solid var(--pink);
    box-shadow:0 24px 44px rgba(0,0,0,.14);
  }

  .titlebar{
    background:#f7b7cf;
    padding:8px 10px;
    display:flex;
    justify-content:space-between;
    border-bottom:6px solid var(--pink);
    font-size:12px;
  }

  .content{
    padding:16px;
    text-align:center;
    background:repeating-linear-gradient(
      45deg,#ffeaf3,#ffeaf3 10px,#fff5fa 10px,#fff5fa 20px
    );
    position:relative;
  }

  .question{font-size:14px;line-height:1.6}
  .from{font-size:11px;margin:8px 0 10px;color:#8b1d4a}

  /* Girl image: big by default + smooth grow after YES */
  #girlImg{
    width:220px;
    image-rendering:pixelated;
    margin:6px 0 12px;
    transform: translateY(-6px) scale(1);
    animation: softBounce 1.9s ease-in-out infinite;
    transition: transform 0.6s ease, filter 0.6s ease;
  }
  @keyframes softBounce {
    0%,100% { transform: translateY(-6px) scale(1); }
    50%     { transform: translateY(-12px) scale(1); }
  }

  .buttons{position:relative;height:62px;margin-top:8px}
  button{
    font-family:"Press Start 2P";
    font-size:12px;
    padding:10px 18px;
    border:4px solid var(--pink);
    background:#fff;
    cursor:pointer;
    position:absolute;
  }
  #yes{left:78px}
  #no{left:240px}

  .result{
    display:none;
    margin-top:14px;
    padding:14px;
    border:4px solid var(--pink);
    background:#fff;
    font-size:12px;
    line-height:1.7;
  }
  .tip{font-size:9px;margin-top:10px;opacity:.6}

  /* Sparkles after YES */
  .sparkles{ position:absolute; inset:0; pointer-events:none; overflow:hidden; }
  .sparkles i{
    position:absolute;
    left:50%;
    top:50%;
    transform:translate(-50%,-50%);
    font-style:normal;
    opacity:0;
    animation: pop 900ms ease-out forwards;
  }
  @keyframes pop {
    0%   { opacity:0; transform:translate(-50%,-50%) scale(.6); }
    15%  { opacity:1; }
    100% {
      opacity:0;
      transform:translate(calc(-50% + var(--dx)), calc(-50% + var(--dy))) scale(1.2);
    }
  }

/* Floating background hearts */
.bg-hearts {
  position: fixed;
  inset: 0;
  overflow: hidden;
  pointer-events: none;
  z-index: 0;
}
.bg-hearts span {
  position: absolute;
  bottom: -20px;
  font-size: 14px;
  animation: floatUp linear infinite;
  opacity: 0.6;
}
@keyframes floatUp {
  from {
    transform: translateY(0) scale(0.8);
    opacity: 0.6;
  }
  to {
    transform: translateY(-110vh) scale(1.2);
    opacity: 0;
  }
}

</style>
</head>

<body>

<div class="bg-hearts"></div>


<div class="window">
  <div class="titlebar">
    <span>LOVE ‚ô• ‚ô• ‚ô•</span>
    <span>‚ñ° ‚ñ° ‚ñ°</span>
  </div>

  <div class="content">
    <div class="question">
      I made this just for you‚Ä¶ will you be my Valentine? ‚ù§Ô∏è
    </div>

    <div class="from">
      From someone who really likes you ‚ù§Ô∏è
    </div>

    <div class="sparkles" id="sparkles"></div>

    <img id="girlImg" alt="cute pixel girl holding a heart">

    <div class="buttons" id="btnArea">
      <button id="yes">Yes</button>
      <button id="no">No</button>
    </div>

    <div class="result" id="result">
      Yippppeeee! ü•πüíñ<br><br>
      I knew it‚Ä¶ Happy Valentine‚Äôs Day,<br>
      my favorite person ‚ù§Ô∏è
    </div>

    <div class="tip">Tip: try pressing No üòà</div>
  </div>
</div>

const girlImg = document.getElementById("girlImg");
girlImg.src = "data:image/png;base64," + GIRL_BASE64;

/* Buttons */
const noBtn = document.getElementById("no");
const yesBtn = document.getElementById("yes");
const result = document.getElementById("result");
const btnArea = document.getElementById("btnArea");
const sparkles = document.getElementById("sparkles");

function moveNo(){
  noBtn.style.left = Math.random()*280 + "px";
  noBtn.style.top  = Math.random()*34  + "px";
}
noBtn.onmouseenter = moveNo;
noBtn.onclick = moveNo;
noBtn.ontouchstart = (e)=>{ e.preventDefault(); moveNo(); };

function burstHearts(){
  const hearts = ["üíó","üíñ","üíï","üíò","üíû"];
  for (let i=0;i<14;i++) {
    const el = document.createElement("i");
    el.textContent = hearts[Math.floor(Math.random()*hearts.length)];
    const dx = (Math.random()*260 - 130).toFixed(0) + "px";
    const dy = (Math.random()*220 - 110).toFixed(0) + "px";
    el.style.setProperty("--dx", dx);
    el.style.setProperty("--dy", dy);
    el.style.left = "50%";
    el.style.top  = "42%";
    el.style.fontSize = (12 + Math.random()*16).toFixed(0) + "px";
    sparkles.appendChild(el);
    setTimeout(()=> el.remove(), 950);
  }
}

yesBtn.onclick = ()=>{
  burstHearts();
  girlImg.style.animation = "none";
  girlImg.style.transform = "translateY(-10px) scale(1.45)"; /* grows after YES */
  girlImg.style.filter = "drop-shadow(0 12px 22px rgba(214,75,127,.35))";
  result.style.display = "block";
  btnArea.style.display = "none";
};

/* Background floating hearts */
const bg = document.querySelector(".bg-hearts");
const heartIcons = ["üíó","üíñ","üíï","üíò","üíû"];

setInterval(() => {
  const heart = document.createElement("span");
  heart.textContent = heartIcons[Math.floor(Math.random() * heartIcons.length)];
  heart.style.left = Math.random() * 100 + "vw";
  heart.style.animationDuration = (6 + Math.random() * 4) + "s";
  heart.style.fontSize = (10 + Math.random() * 16) + "px";

  bg.appendChild(heart);
  setTimeout(() => heart.remove(), 10000);
}, 400);

</script>

</body>
</html>
